import React from 'react';

import './ListBikeItem.css';

const ListBikeItem = ({ items }) => {

    console.log(items.name)

    const { name, type, price } = items;
    
    return (
        <div className="listBikeItem d-flex">
            <p>{`${name} / ${type} / $${price}`}</p>
            <button className="btn btn-outline-danger btn-sm float-right">Delete</button>
            <button className="btn btn-outline-success btn-sm float-right">Delete</button>
        </div>
    );
};

export default ListBikeItem;
